INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 7, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, "キャル", 1, 106001, 0.0, "2015/12/17 15:00:00", 7001);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 7, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, "コッコロ", 1, 105901, 0.0, "2015/12/17 15:00:00", 7002);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 7, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, "ペコリーヌ", 1, 105801, 0.0, "2015/12/17 15:00:00", 7003);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 10, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, "ペコリーヌ", 1, 105801, 0.0, "2015/12/17 15:00:00", 10001);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 10, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, "キャル", 1, 106001, 0.0, "2015/12/17 15:00:00", 10002);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 10, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, "コッコロ", 1, 105901, 0.0, "2015/12/17 15:00:00", 10003);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 10, 0.0, 0, 2104010, "2030/12/17 14:59:59", 1, "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 2, "シェフィ", 1, 106401, 0.0, "2015/12/17 15:00:00", 10004);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-416.5, 12, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, "ペコリーヌ", 1, 105801, 0.0, "2015/12/17 15:00:00", 12001);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 13, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, "キャル", 1, 106001, 0.0, "2015/12/17 15:00:00", 13001);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 13, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, "コッコロ", 1, 105901, 0.0, "2015/12/17 15:00:00", 13002);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 13, 0.0, 0, 2104010, "2030/12/17 14:59:59", 1, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 2, "シェフィ", 1, 106401, 0.0, "2015/12/17 15:00:00", 13003);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 13, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, "ペコリーヌ", 1, 105801, 0.0, "2015/12/17 15:00:00", 13004);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 14, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, "コッコロ", 1, 105901, 0.0, "2015/12/17 15:00:00", 14001);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 14, 0.0, 0, 2104010, "2030/12/17 14:59:59", 1, "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 2, "シェフィ", 1, 106401, 0.0, "2015/12/17 15:00:00", 14002);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 14, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, "ペコリーヌ", 1, 105801, 0.0, "2015/12/17 15:00:00", 14003);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 14, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, "キャル", 1, 106001, 0.0, "2015/12/17 15:00:00", 14004);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-470.0, 15, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, "コッコロ", 1, 105901, 0.0, "2015/12/17 15:00:00", 15001);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 16, 0.0, 0, 2104010, "2030/12/17 14:59:59", 1, "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 2, "シェフィ", 1, 106401, 0.0, "2015/12/17 15:00:00", 16001);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 16, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, "ペコリーヌ", 1, 105801, 0.0, "2015/12/17 15:00:00", 16002);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 16, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, "キャル", 1, 106001, 0.0, "2015/12/17 15:00:00", 16003);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 16, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, "コッコロ", 1, 105901, 0.0, "2015/12/17 15:00:00", 16004);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 17, 0.0, 0, 0, "2030/12/17 14:59:59", 1, " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, "コッコロ", 1, 105901, 0.0, "2015/12/17 15:00:00", 17002);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 25, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, "キャル", 1, 106001, 0.0, "2015/12/17 15:00:00", 17004);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 25, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, "コッコロ", 1, 105901, 0.0, "2015/12/17 15:00:00", 17005);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 25, 0.0, 0, 2104010, "2030/12/17 14:59:59", 1, "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 2, "シェフィ", 1, 106401, 0.0, "2015/12/17 15:00:00", 17006);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 25, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, "ペコリーヌ", 1, 105801, 0.0, "2015/12/17 15:00:00", 17007);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 18, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, "カリン", 1, 190801, 0.0, "2015/12/17 15:00:00", 18001);
