INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-470.0, 19, 0.0, 0, 0, "2030/12/17 14:59:59", 4, "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 1, "カリン", 1, 190801, 0.0, "2015/12/17 15:00:00", 19002);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-470.0, 20, 0.0, 0, 0, "2030/12/17 14:59:59", 5, "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 1, "カリン", 1, 190801, 0.0, "2015/12/17 15:00:00", 20001);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-470.0, 20, 0.0, 0, 0, "2030/12/17 14:59:59", 6, "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 1, "カリン", 1, 190801, 0.0, "2015/12/17 15:00:00", 20002);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 21, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, "キャル", 1, 106001, 0.0, "2015/12/17 15:00:00", 21001);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 21, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, "コッコロ", 1, 105901, 0.0, "2015/12/17 15:00:00", 21002);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 21, 0.0, 0, 2104010, "2030/12/17 14:59:59", 1, "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 2, "シェフィ", 1, 106401, 0.0, "2015/12/17 15:00:00", 21003);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 21, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, "ペコリーヌ", 1, 105801, 0.0, "2015/12/17 15:00:00", 21004);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-430.0, 22, 0.0, 0, 0, "2030/12/17 14:59:59", 1, "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, "カリン", 1, 190801, 0.0, "2015/12/17 15:00:00", 22001);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-430.0, 22, 0.0, 0, 0, "2030/12/17 14:59:59", 2, "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 1, "カリン", 1, 190801, 0.0, "2015/12/17 15:00:00", 22002);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-430.0, 23, 0.0, 0, 0, "2030/12/17 14:59:59", 3, "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 1, "カリン", 1, 190801, 0.0, "2015/12/17 15:00:00", 23001);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-430.0, 23, 0.0, 0, 0, "2030/12/17 14:59:59", 4, "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 1, "カリン", 1, 190801, 0.0, "2015/12/17 15:00:00", 23002);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, 24, 4.08, 10011, 0, "2030/12/17 14:59:59", 1, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 1, "エリコ（バレンタイン）", 2, 109001, 8.0, "2019/01/31 12:00:00", 24001);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, 24, 5.0, 10011, 0, "2030/12/17 14:59:59", 2, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 1, "エリコ（バレンタイン）", 2, 109001, 8.0, "2019/01/31 12:00:00", 24002);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, 24, 10.11, 10011, 0, "2030/12/17 14:59:59", 3, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 1, "エリコ（バレンタイン）", 2, 109001, 8.0, "2019/01/31 12:00:00", 24003);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, 24, 4.0, 10011, 0, "2030/12/17 14:59:59", 4, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 1, "エリコ（バレンタイン）", 2, 109001, 8.0, "2019/01/31 12:00:00", 24004);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, 24, 6.0, 10011, 0, "2030/12/17 14:59:59", 5, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 1, "エリコ（バレンタイン）", 2, 109001, 8.0, "2019/01/31 12:00:00", 24005);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 24, 0.0, 10011, 0, "2030/12/17 14:59:59", 6, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 1, "エリコ（バレンタイン）", 1, 109002, 0.0, "2019/01/31 12:00:00", 24006);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 24, 0.0, 10011, 0, "2030/12/17 14:59:59", 7, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 1, "エリコ（バレンタイン）", 1, 109002, 0.0, "2019/01/31 12:00:00", 24007);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 24, 0.0, 10011, 0, "2030/12/17 14:59:59", 8, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 1, "エリコ（バレンタイン）", 1, 109002, 0.0, "2019/01/31 12:00:00", 24008);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 24, 0.0, 10011, 0, "2030/12/17 14:59:59", 9, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 1, "エリコ（バレンタイン）", 1, 109002, 0.0, "2019/01/31 12:00:00", 24009);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 24, 0.0, 10011, 0, "2030/12/17 14:59:59", 10, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 1, "エリコ（バレンタイン）", 1, 109002, 0.0, "2019/01/31 12:00:00", 24010);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, 24, 2.12, 10011, 0, "2030/12/17 14:59:59", 1, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 1, "シズル（バレンタイン）", 2, 109101, 8.0, "2019/01/31 12:00:00", 24011);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, 24, 4.19, 10011, 0, "2030/12/17 14:59:59", 2, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 5, "シズル（バレンタイン）", 2, 109101, 8.0, "2019/01/31 12:00:00", 24012);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, 24, 2.3, 10011, 0, "2030/12/17 14:59:59", 3, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 2, "シズル（バレンタイン）", 4, 109101, 8.0, "2019/01/31 12:00:00", 24013);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 24, 0.0, 10011, 0, "2030/12/17 14:59:59", 4, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 1, "シズル（バレンタイン）", 1, 109102, 0.0, "2019/01/31 12:00:00", 24014);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, 24, 5.23, 10011, 0, "2030/12/17 14:59:59", 5, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5, "シズル（バレンタイン）", 2, 109101, 8.0, "2019/01/31 12:00:00", 24015);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 24, 0.0, 10011, 0, "2030/12/17 14:59:59", 6, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 1, "シズル（バレンタイン）", 1, 109102, 0.0, "2019/01/31 12:00:00", 24016);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-385.0, 24, 5.01, 10011, 0, "2030/12/17 14:59:59", 7, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 1, "シズル（バレンタイン）", 2, 109101, 8.0, "2019/01/31 12:00:00", 24017);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 24, 0.0, 10011, 0, "2030/12/17 14:59:59", 8, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 1, "シズル（バレンタイン）", 1, 109102, 0.0, "2019/01/31 12:00:00", 24018);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 24, 0.0, 10011, 0, "2030/12/17 14:59:59", 9, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 1, "シズル（バレンタイン）", 1, 109102, 0.0, "2019/01/31 12:00:00", 24019);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (0.0, 24, 0.0, 10011, 0, "2030/12/17 14:59:59", 10, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 1, "シズル（バレンタイン）", 1, 109102, 0.0, "2019/01/31 12:00:00", 24020);
INSERT INTO `v1_a299dbb870bb146ccd5bdc54aed56a43daf577833c79503a68531d4d1bf254c9` VALUES (-363.0, 26, 0.0, 0, 2104010, "2030/12/17 14:59:59", 1, "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 2, "シェフィ", 1, 106401, 0.0, "2015/12/17 15:00:00", 26001);
